            <p>Loading...</p>
          )
        }
        <div className="server">
          <img src=""/>
          <h2>Name</h2>
          <p>This person hasn't put in a description for their server, so this is the default description. Make sure to tell them to change it into something more soothing.</p>
        </div>
      </div>
    </Layout>
  )
  }
}
